import React, { Component } from 'react';
import logo from '../../logo.svg';
import './Header.css';

export default class Header extends Component {
    constructor() {
        super();
        this.state = {
            red: true,
            tile1: "red"
        };
    }

    render() {
        return (
            <div className="header-wrap">
                <div className="logo-container">
                    <a href="" className="logo-icon">Logo/Brand</a>
                </div>
                <div className="navbar">
                    <button className="nav-button">bOne</button>
                    <button>bTwo</button>
                    <button>bThree</button>
                    <button>bFour</button>
                </div>
            </div>
        );
    }
}
